import * as React from 'react';
import { Provider } from 'react-redux';
import styled from 'styled-components';

import './App.css';
import {PhotosList} from './modules/PhotosList/PhotosList';
import store from './store';

const PhotoListContainer = styled.div`
  width: 90%;
  margin: 0 auto;
  padding: 10px;
`;

class App extends React.Component {

  public render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Carousel Test</h1>
        </header>
          <Provider store={store}>
          <div>
            <PhotoListContainer>
                <PhotosList />
            </PhotoListContainer>
            </div>
          </Provider>
      </div>
    );
  }
}

export default App;

import { applyMiddleware, createStore } from 'redux';
import thunk from 'redux-thunk';
import reducer from './reducers/index';

const createDevelopmentMiddleware = () => {
    return applyMiddleware(thunk);
};

const createProductionMiddleware = () => {
    return applyMiddleware(thunk);
};

const middleware = process.env.NODE_ENV !== 'production' ? createDevelopmentMiddleware() : createProductionMiddleware();
const store = createStore(reducer, middleware);

export default store;

import { Action } from 'redux';
import { ThunkDispatch } from 'redux-thunk';

import { apiGetPhotos } from '../utilities/api';

import {
    getPhotosFailed,    
    getPhotosLoaded,
    getPhotosSuccess,
} from './action-types/action-types';

const url = 'https://jsonplaceholder.typicode.com/photos';

export const getPhotos = (onSuccess?: () => void) => {
    return async (dispatch: ThunkDispatch<any, any, Action>) => {
         dispatch(getPhotosLoaded());
        try {
            const res = await apiGetPhotos(url);
             dispatch(getPhotosSuccess(res.data));

            if (onSuccess) {
                onSuccess();
            }

        } catch (e) {
            dispatch(getPhotosFailed(e))
        }
    }
}

export const TYPES = {
    FAILED: "LOAD_FAILED",    
    PENDING: "LOAD_PENDING",
    SUCCESS: "LOAD_SUCCESS",
}

export const getPhotosFailed = (error: any) => ({
    type: TYPES.FAILED,
    isLoading: false,
    isError: true,
    error
});

export const getPhotosLoaded = () => ({
    type: TYPES.PENDING,
    isLoading: true,
    isError: false
});

export const getPhotosSuccess = (data: any) => ({
    type: TYPES.SUCCESS,
    isLoading: false,
    isError: false,
    data
});

import * as React from 'react';
import styled from 'styled-components';
import LazyLoad from 'react-lazy-load';

const Img = styled.img`
    display: block;
    width: 200px;
    height: auto;
    padding: 10px;
    margin: 0 auto;
    vertical-align: middle;
    horizontal-align: center;
    text-align: center;    
`;

const PhotoContainer = styled.div`
    display: block;
`;

interface IPhotoProps {
    id: number;
    thumbnailUrl: string;
    url: string;
    title: string;
};

export const Photo: React.StatelessComponent<IPhotoProps> = (props: IPhotoProps) => {
    return(
        <PhotoContainer>
            <LazyLoad>
